<div class="entities" style="line-height: 2.5; direction: ltr">Radiolabeled ligand binding to the catalytic or allosteric sites of

 and PDE 11 . Cyclic nucleotide phosphodiesterases ( PDEs ) have been investigated for years as targets for therapeutic intervention in a number of pathophysiological processes . Phosphodiesterase - 5 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) , which is highly specific for guanosine 3 ' - 5 ' - cyclic-monophosphate ( cGMP ) at both its catalytic site and its allosteric sites , has generated particular interest because it is potently and specifically inhibited by three drugs : sildenafil ( Viagra , Pfizer ) , tadalafil ( DB00820 , Lilly - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) , and vardenafil ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00862
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , Bayer GSK ) . Previously , we have used [ ( 3 ) H ] cGMP to directly study the interaction of cGMP with the allosteric sites of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    O76074
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 , but because cGMP binds with relatively low affinity to the catalytic site , it has been difficult to devise a binding assay for this particular binding reaction . This approach using measurement of radiolabeled ligand binding continues to allow us to more precisely define functional features of the enzyme . We now use a similar approach to study the characteristics of high-affinity [ ( 3 ) H ] inhibitor binding to the

 catalytic domain . For these studies , we have prepared [ ( 3 ) H ] sildenafil and [ ( 3 ) H ] tadalafil , two structurally different competitive inhibitors of

<div class="entities" style="line-height: 2.5; direction: ltr">Suppression of androgen receptor-mediated gene expression by a sequence-specific DNA-binding polyamide .

 was detected only in the carcinomatous area , whereas beta-catenin , BCL - 2 ,

 , p16 ( INK 4a ) ,

<div class="entities" style="line-height: 2.5; direction: ltr">Activity and potential role of licofelone in the management of osteoarthritis . Osteoarthritis is the most common form of arthritis . It is a progressive joint disease associated with aging . It may be found in the knees , hips , or other joints . It is estimated that costs associated with osteoarthritis exceed 2 % of the gross national product in developed countries . Nonsteroidal anti-inflammatory drugs ( NSAIDs ) are a mainstay in the treatment of inflammatory disease and are among the most widely used drugs worldwide . The main limitation in using NSAIDs consists in their side-effects , including gastrointestinal ulcerogenic activity and bronchospasm . The mechanism of action of these drugs is attributed to the inhibition of cyclooxygenase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) , and , consequently , the conversion of arachidonic acid into prostaglandins . It is hypothesized that the undesirable side-effects of NSAIDs are due to the inhibition of

 ( constitutive isoform ) , whereas the beneficial effects are related to the inhibition of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ( inducible isoform ) . Arachidonic acid can also be converted to leukotrienes ( LTs ) by the action of

 , a P28300 /

 competitive inhibitor , decreases the production ofproinflammatory leukotrienes and prostaglandins ( which are involved in the pathophysiology of osteoarthritis and in gastrointestinal ( GI ) damage induced by NSAIDs ) and has the potential to combine good analgesic and anti-inflammatory effects with excellent GI tolerability . Preliminary data with this drug seem promising , but further well-designed clinical trials of this agent in the elderly will be necessary before a final evaluation is possible .</div>

<h2 style="margin: 0">18</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Current and future pharmacologic options for the management of patients unable to achieve low-density lipoprotein-cholesterol goals with statins . Low-density lipoprotein-cholesterol ( LDL-C ) lowering is the mainstay of the current treatment guidelines in the management of cardiovascular risk .

 inhibitors ( statins ) are currently the most effective LDL-C-lowering drugs . However , a substantial number of patients do not reach treatment targets with statins . Therefore , an unmet medical need exists for lipid-lowering drugs with novel mechanisms of action to reach the recommended cholesterol target levels , either by monotherapy or combination therapy . Upregulation of the

 with squalene synthase inhibitors has shown promising results in animal studies but the clinical development of the lead compound lapaquistat (

<h2 style="margin: 0">19</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Metformin suppresses growth of human head and neck squamous cell carcinoma via global inhibition of protein translation . Head and neck squamous cell carcinoma ( HNSCC ) is the sixth leading cancer in the world ; the main risk factors are alcohol and tobacco use . Advancements in therapies have yet to improve the prognosis of HNSCC . The connection between diabetes and cancer is being recognized , and metformin has been shown to decrease cancer incidence in diabetic patients . Accordingly , here , for the first time , we investigated metformin ' s efficacy on the growth and viability of human HNSCC FaDU and Detroit cells . Our results show that metformin treatment ( 5-20 mM ) dose-dependently inhibits the growth of both cell lines . In FaDU cells , metformin caused 18-57 % and 35-81 % growth inhibition after 48 and 72 h treatments , respectively . Similarly , in Detroit 562 cells , 48 and 72 h metformin treatment resulted in 20-57 % and 33-82 % inhibition , respectively . Mechanistically , metformin caused G 1 arrest , which coincided with a decrease in the protein levels of CDKs ( 2 , 4 and 6 ) , cyclins ( D1 and E ) and CDK inhibitors ( p15 , p16 , p18 and p27 ) , but no change in p19 and

    P38936

</mark>
 . Metformin also decreased the levels of oncogenic proteins Skp 2 and β-Trcp . In other studies , metformin decreased the phosphorylation of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q13541
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 at Ser 65 , Thr 37/46 and Thr 70 sites , but drastically increased the phosphorylation of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13639
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 at Thr 56 and AMPK at Thr 172 , which results in global translational inhibition . In summary , the observed wide spectrum of mechanistic effects of metformin on HNSCC cells provides support for the anticancer capability of the drug and its potential use in future therapies .</div>
